@Babydreaming I get the same thing, wake up about 3.30 and am wide awake!
Has anyone had a stuffy nose since they became pregnant? I'm not talk about a winter cold. This feels more like when you have allergies.
Good luck telling your partner it's an exciting time.

@Babydreaming it is really expensive! I didn't realise the NHS offered it now, I thought that was only a pilot in some areas.
Good luck with telling your husband! I am sure he'll be over the moon.
I am actually contemplating waiting until Christmas to tell mine, but will probably cave in this weekend.
